import React, { Component } from 'react';
// import Letter from './Letter.js'

class Letter extends Component {
    constructor(){
        super()
        this.letter = ""
    }

    defineLetter(letter){
        this.letter = letter
    }

    render() {
        this.defineLetter(this.props.let)
        return (
            <div>
                {this.letter}   
            </div>
        );
    }
}

class Letters extends Component {
    render() {
        return (
            <div>
                <Letter let="A"/>
            </div>
        );
    }
}

export default Letters;
